let SidenavModeInstance = null;
module.exports = class sidenavmode {

    constructor() {
        if (!SidenavModeInstance) {
            SidenavModeInstance = this;
            //set all other default values

            this.displayAs = 'Sidenav Mode';
            this.value = '[sidenavMode]'
            this.type = 'DROPDOWN';
            this.values = [
                { display: "None", value: ""},                
                { display: "Over", value: "'over'"},
                { display: "Side", value: "'side'"},
                { display: "Push", value: "'push'"}

            ];
        }

        return SidenavModeInstance;
    }
}